function interpret(e,t,n){var r=0,i="",s=0,o=[0],u=0,a="",f=0;var l=function(e,t){var n=0,r="";for(var i=t-1;i>=0;i--){r=e.charAt(i);if(n==0&&r=="[")return i;else{if(r=="[")n--;if(r=="]")n++}}return-1};var c=function(e,t){var n=0,r="";for(var i=t+1;i<e.length;i++){r=e.charAt(i);if(n==0&&r=="]")return i;else{if(r=="]")n--;if(r=="[")n++}}return-1};e=e.replace(/[^<>,\.\[\]\+-]/g,"");for(r=0;r<e.length;r++){i=e.charAt(r);switch(i){case"+":o[u]++;break;case"-":o[u]--;break;case">":u++;if(u==o.length)o.push(0);break;case"<":u--;break;case".":a+=String.fromCharCode(o[u]);break;case",":if(s==t.length)o[u]=0;else o[u]=t.charCodeAt(s++);break;case"[":if(o[u]==0)r=c(e,r);break;case"]":if(o[u]!=0)r=l(e,r);break}f++;if(n>0&&n<f)return a}return a}
